;; **
;;; # Transform the RTF Graph into an STN
;;; 
;;; STN Graphs are simply Time Point (TP) nodes connected by eighted edges. The conversion from RTF to STN is done in 7 steps:
;;; 
;;; 1. **Unroll Duration**: we unroll the top level _Frame_ for the duration specified in the requirement
;;; 2. **Split SubFrame**: we split the subframes of the "unrolled" frames, so that each unrolled frame has its own subframe
;;; 3. **Unroll Frame**: we unroll Frames by creating the right number if subframes
;;; 4. **Connect Subframes**: we connect the ends of terminal subframes to create a cohesive sequence of subframes
;;; 5. **Remove Parent Frame**: we remove the parent frames (which are not longer needed) (this step is not really needed - but makes the graph less cluttered)
;;; 6. **Filter Iteration**: this step filters out only those frames where an event needs to happen
;;; 7. **Create TimePoints**: create TPs for each filtered frame
;;; 
;;; ## 1. Unroll Duration
;;; 
;;; This step replicates the "top frame" for _duration_ times
;; **

;; @@
(rule 'unroll-duration!
      :read (pattern (node 'r :label "Require")
                     (node 'f :label "Frame")
                     (path ">:sub*1..1 >:next*0.." :src 'r :tar 'f)
                     (NAC 
                      (node 'n :label "Frame")
                      (edge :label "next" :src 'f :tar 'n)
                      )
                     (condition "f.ordtot < r.duration")
                     (node 'sf :label "Frame")
                     (edge :label "sub" :src 'f :tar 'sf)
                     )
      :create (pattern 
                (node 'f2 :label "Frame" :asserts {:unit "f.unit" :kind "f.kind" :q "f.q" :ordtot "f.ordtot+1" :ordrel "f.ordrel+1"})
                (edge :label "next" :src 'f :tar 'f2)
                (edge :label "sub" :src 'f2 :tar 'sf)
               ))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"572\" height=\"368\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x58248e13 \"BufferedImage@58248e13: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@bbdbc80 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 572 height = 368 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; ## 2. Split Subframe
;;; 
;;; This step splits the _sub_ frames. 
;;; 
;;; _Note: right now this is implemented for "weeks" only. Todo: implement a more generic version of this operation for other units._
;; **

;; @@
(rule 'split-subframe!
      :read (pattern :iso
             (node 'p1 :label "Frame" :asserts {:unit "'week'" :ordrel "1"})
             (node 'p2 :label "Frame" :asserts {:unit "'week'"})
             (node 'f :label "Frame" :asserts {:unit "'day'"})
             (node 'c)
             (edge :label "sub" :src 'p1 :tar 'f)
             (edge 's :label "sub" :src 'p2 :tar 'f)
             (edge :label "sub" :src 'f :tar 'c)
                     )
      :delete ['s]
      :create (pattern 
                (node 'fc :label "Frame" :asserts {:unit "f.unit" :q "f.q" :kind "f.kind" :ordrel "f.ordrel" :ordtot "f.ordrel + 7 * (p2.ordtot-1)"})
                (edge :label "sub" :src 'fc :tar 'c)
                (edge 'sn :label "sub" :src 'p2 :tar 'fc)
               ))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"603\" height=\"289\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x66ee278 \"BufferedImage@66ee278: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@bbdbc80 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 603 height = 289 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; ## 3. Unroll Frame
;;; 
;;; After splitting the sub-frame, we unroll it.
;;; 
;;; _Note: this is currently only done for _week_ frames (that have _day_ subframes). Todo: general implementation._
;; **

;; @@
(rule 'unroll-frame!
      :read (pattern 
             (node 'fw :label "Frame" :asserts {:unit "'week'"})
             (node 'fd :label "Frame" :asserts {:unit "'day'"})
             (path ">:sub*1..1 >:next*0.." :src 'fw :tar 'fd)
             (node 's)          
             (edge :label "sub" :src 'fd :tar 's)
             (NAC 
              (node 'nfd :label "Frame" :asserts {:unit "'day'"})
              (edge :label "next" :src 'fd :tar 'nfd)
              )
             (condition "fd.ordrel <7")
             )
      :create (pattern
               (node 'fdn :label "Frame" :asserts {:unit "'day'" :ordrel "fd.ordrel+1" :ordtot "(fd.ordrel+1)+7*(fw.ordtot-1)" :q "fd.q" :kind "fd.kind"})
               (edge :label "next" :src 'fd :tar 'fdn)
               (edge :label "sub" :src 'fdn :tar 's)
               ))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"712\" height=\"384\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x405472b6 \"BufferedImage@405472b6: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@bbdbc80 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 712 height = 384 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; ## 4. Connect Sub Frames!
;;; 
;;; After unrolling a frame, we connect the end-points of it's sub-frames.
;;; 
;;; _Note: this is currently only implemented for _day_ subframes. Todo: general implementation._
;; **

;; @@
(rule 'connect-subframe!
  :read (pattern
          (node 'fp1 :label "Frame" :asserts {:unit "'week'"})
          (node 'fp2 :label "Frame" :asserts {:unit "'week'"})
          (edge :label "next" :src 'fp1 :tar 'fp2)
          (node 'last :label "Frame" :asserts {:ordrel "7"})
          (node 'f :label "Frame")
          (edge :label "sub" :src 'fp1 :tar 'f)
          (node 'first :label "Frame")
          (path ">:next*6..6" :src 'f :tar 'last)
          (edge :label "sub" :src 'fp2 :tar 'first)
          (NAC
            (node 'neg1)
            (edge :label "next" :src 'last :tar 'neg1))
          )
  :create (pattern
            (edge :label "next" :src 'last :tar 'first)))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"207\" height=\"407\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4e4fd29f \"BufferedImage@4e4fd29f: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@bbdbc80 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 207 height = 407 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; ## 5. Remove Parent Frame
;;; 
;;; Now we can remove the parent frames. 
;;; 
;;; _Note: this is currently only implemented for parent frames of unit "week". Todo: general implementation._
;; **

;; @@
(rule 'jump-over-parent!
      :read (pattern 
             (node 'p)
             (node 'wf :label "Frame" :asserts {:unit "'week'"})
             (edge :label "sub" :src 'p :tar 'wf)
             (edge :label "sub" :src 'wf :tar 'df)
             (node 'df :label "Frame" :asserts {:unit "'day'"})
             (NAC 
              (edge :label "sub" :src 'p :tar 'df)
              ))
      :create (pattern
               (edge :label "sub" :src 'p :tar 'df))
      )
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"230\" height=\"289\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2f9b3f7a \"BufferedImage@2f9b3f7a: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@bbdbc80 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 230 height = 289 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; @@
(rule 'delete-parent!
      :read (pattern 
             (node 'wf :label "Frame" :asserts {:unit "'week'"}))
      :delete ['wf]
      )

(defn remove-parent-frames! []
	(while (jump-over-parent!))
	(while (delete-parent!)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;chaos.core-test/remove-parent-frames!</span>","value":"#'chaos.core-test/remove-parent-frames!"}
;; <=

;; **
;;; ## 6. Filter iteration
;;; 
;;; Now we filter out those frames that are targeted by the prescribed iteration.
;;; 
;;; _Note: todo filter by selection_
;; **

;; @@
(rule 'filter-iteration!
      :read (pattern
             (node 'f :label "Frame" :asserts {:kind "'iteration'"})
             (node 'p)
             (node 'n)
             (edge :label "next" :src 'p :tar 'f)
             (edge :label "next" :src 'f :tar 'n)
             (node 's :label "Frame" :opt true)
             (path ">:sub*" :src 'f :tar 's :opt true)
             (condition "(f.ordtot-1) % f.q <> 0"))
      :delete ['f 's]
      :create (pattern
               (edge :label "next" :src 'p :tar 'n)))
