;; **
;;; ## 7. Create STN
;;; 
;;; We finally create the STN nodes and edges
;;; 
;;; _Note: this is currently done based on "day" frames and with the resultion of hours only_
;; **

;; @@
(rule 'create-first-TP!
      :read (pattern 
             (node 'r :label "Require")
             (node 'f :label "Frame")
             (edge :label "sub" :src 'r :tar 'f)
             )
      :create (pattern
               (node 'tps :label "TP")
               (edge :label "start" :src 'tps :tar 'r)
               (node 'tp :label "TP")
               (edge :label "in" :src 'tp :tar 'f)
               (edge :label "cons" :src 'tps :tar 'tp :asserts {:max "24"})
               (edge :label "cons" :src 'tp :tar 'tps :asserts {:max "0"})
               
       ))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"203\" height=\"374\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x50cd0425 \"BufferedImage@50cd0425: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@bbdbc80 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 203 height = 374 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; @@
(rule 'create-TP!
      :read (pattern 
             (node 'p :label "Frame")
             (edge :label "next" :src 'p :tar 'f)
             (node 'f :label "Frame")
             (node 'ptp :label "TP")
             (edge :label "in" :src 'ptp :tar 'p)
             (NAC 
              (node 'ntp :label "TP")
              (edge :label "in" :src 'ntp :tar 'f)
              ))
       :create (pattern
               (node 'tpnew :label "TP")
               (edge :label "in" :src 'tpnew :tar 'f)
               (edge :label "cons" :src 'ptp :tar 'tpnew :asserts {:max "(f.ordtot - p.ordtot) *24"})
               (edge :label "cons" :src 'tpnew :tar 'ptp :asserts {:max "-(f.ordtot - p.ordtot -1) *24"})            
             )
       )
;; @@
;; =>
