;; **
;;; # Wrap all steps in a function:
;;; 
;; **

;; @@
(rule 'TP?
      :read (pattern
                 (node 'n :label "TP")
                 (node 'm :label "TP")
                 (edge :src 'n :tar 'm :opt true)))

(defn transform [s]
  (clear!)
  (createRTF! (parse s))
  (while (unroll-duration!))
  (while (split-subframe!))
  (while (unroll-frame!))
  (while (connect-subframe!))
  (remove-parent-frames!)
  (while (filter-iteration!))
  (create-first-TP!)
  (while (create-TP!))
  (-> TP? matches view))
